import React from 'react'
import './TopButtons.css'

function TopButtons() {

    const pages = [
        {name: 'Today', url: '/'},
        {name: 'History', url: '/history'}
    ]

  return (
    <div className='topbuttons'>{pages.map((page) => (
        <button>{page.name}</button>
    ))}</div>
  )
}

export default TopButtons;
